import React, { Component } from 'react'

export default class Chart extends Component {
    state = {
        tickerDisplayed: null
    }
    
    render() {
        let tickerDisplayed = (<div><input></input></div>)
        if(this.props.chartsTicker){
             tickerDisplayed = (
                <div>
                    {this.props.chartsTicker}
                </div>
            )
        }
        return (
            <div>
                <div>
                    Here is Chart for  
                </div>
                {tickerDisplayed}
            </div>
        )
    }
}
